import React from "react";
import styled from "styled-components";
const Reservation = () => {
  return (
    <StyledDiv>
      <h1>Check your reservation:</h1>
      <form>
        <input placeholder="Reservation ID" type="text" />
      </form>
    </StyledDiv>
  );
};

const StyledDiv = styled.div`
  display: flex;
  flex
`;

export default Reservation;
